import React from 'react';
import { StyledNav, List } from './styles';

export interface ICatalogNav {
  display: boolean;
}

const CatalogNav: React.FC<ICatalogNav> = ({ display }) => {
  return (
    <StyledNav display={display}>
      <List>
        <li>something</li>
      </List>
    </StyledNav>
  )
}

export default CatalogNav;
